          <path d="M402 295L369.957 246.25L434.043 246.25L402 295Z" fill="#70AE98"/>
          <path d="M549 189L500.25 221.043L500.25 156.957L549 189Z" fill="#ECBE7A"/>
        </g>
      </g>
    </svg>
  </Header>
}

export default PageHeader
